import {Link} from "react-router-dom";
import "./item.css"

function Chips() {
    return (
        <div>
            <imag className="item" src="https://a57.foxnews.com/static.foxnews.com/foxnews.com/content/uploads/2018/09/931/524/sunchips.jpg?ve=1&tl=1s"/>
            <Link className="back" to="/">go back</Link>
        </div>
    )
}

export default Chips;
